var areaSelectLength = 0;
$.extend($.fn,{
	addressSelect:function(option){
		$(this).each(function(){
			var suffix = '';
			if(areaSelectLength > 0){
				suffix = areaSelectLength;
			}
			var defaultOption = {
				css:'',//列表css类
				provinceName:'province',//表单省字段name
				cityName:'city',//表单市字段name
				districtName:'district',//表单区字段name
				zipCodeElem:null,//邮编元素，自动获取邮编
				provinceLabel:'province-label',
				cityLabel:'city-label',
				districtLabel:'distict-label'
			},
			$province = $('<select id="areaProvince' + suffix + '" class="new_box_select"><option value="">请选择省</option></select>'),
			$city = $('<select id="areaCity' + suffix + '" class="new_box_select"><option value="">请选择市</option></select>'),
			$distict = $('<select id="areaDistrict' + suffix + '" class="new_box_select" value=""><option>请选择区/县</option></select>');

			option = $.extend(defaultOption, option);

			$province.attr('name',option.provinceName).addClass(option.css).change(function(){
				if($(this).val() === ''){
					$city.html('<option value="">市</option>').change();
				}else{
					$city.html(optionAppend($(this).val())).change();
				}
			});

			$city.attr('name',option.cityName).addClass(option.css).change(function(){
				if($(this).val() === ''){
					$distict.html('<option value="">区/县</option>').change();
				}else{
					$distict.html(optionAppend($(this).val())).change();
				}
				setZipcode($city.find('option:selected').attr('data-zip'));
			});

			$distict.attr('name',option.districtName).addClass(option.css).change(function(){
				setZipcode($distict.find('option:selected').attr('data-zip'));
			});

			function optionAppend(parent_key){
				var o = '', data = null;
				if(parent_key == 0){
					data = province;
				}else if(subareas[parent_key] != 'undefined'){
					data = subareas[parent_key];
				}
				if(data){
					for(var i=0,len=data.length;i<len;i++){
						o += '<option value="'+data[i].area_id+'" data-zip="'+data[i].zipcode+'">'+data[i].name+'</option>';
					}
				}else{
					o = '<option value="">其他</option>';
				}
				return o;
			}

			function setZipcode(zipcode){
				if(option.zipCodeElem){
					option.zipCodeElem.val(zipcode);
				}
			}
			
			$province.append(optionAppend(0));
			$('#' + option.provinceLabel).append($province);
			$('#' + option.cityLabel).append($city);
			$('#' + option.districtLabel).append($distict);
			areaSelectLength++;
			return true;
		});
	}
});